import React from 'react';
import { Typography, Box, Card, CardContent, Alert } from '@mui/material';

function AgentsMonitor() {
  return (
    <Box>
      <Typography variant="h4" gutterBottom>
        Agents Monitor
      </Typography>

      <Alert severity="info" sx={{ mb: 3 }}>
        Agents monitoring page - shows real-time status of all agents in the swarm
      </Alert>

      <Card elevation={3}>
        <CardContent>
          <Typography variant="h6" gutterBottom>
            Agent Status Overview
          </Typography>
          <Typography variant="body1">
            This page will display detailed information about each agent's status, 
            current tasks, performance metrics, and historical data.
          </Typography>
        </CardContent>
      </Card>
    </Box>
  );
}

export default AgentsMonitor;
